  ctx.strokeStyle = "#bbb", ctx.fillStyle = "#bbb", ctx.lineWidth = 1, ctx.beginPath(), path(marshalls), ctx.fill, ctx.stroke();
  
  var selectCountry = function(name){
    for(var c=0;c<countries.length;c++){
      if(countries[c].name == name){
        return d3.transition()
          .duration(1250)
          .tween("rotate", function() {
            var p = d3.geo.centroid(countries[c]),
                r = d3.interpolate(projection.rotate(), [-p[0], -p[1]]);
            console.log(p);
            return function(t) {
              projection.rotate(r(t));
              ctx.clearRect(0, 0, width, height);
              ctx.fillStyle = "#bbb", ctx.beginPath(), path(land), ctx.fill();
              ctx.fillStyle = "#f00", ctx.beginPath(), path(countries[c]), ctx.fill();
              ctx.strokeStyle = "#fff", ctx.lineWidth = .5, ctx.beginPath(), path(borders), ctx.stroke();
              ctx.strokeStyle = "#000", ctx.lineWidth = 2, ctx.beginPath(), path(globe), ctx.stroke();

  ctx.strokeStyle = "#bbb", ctx.fillStyle = "#bbb", ctx.lineWidth = 1, ctx.beginPath(), path(marshalls), ctx.fill, ctx.stroke();

            };
          });
      }
    }
    // if country was not included, return null
    return null;
  };

  var centerAt = function(latlng){
    return d3.transition()
      .duration(1450)
      .tween("rotate", function() {
        var p = [ latlng[1], latlng[0] ],
            r = d3.interpolate(projection.rotate(), [-p[0], -p[1]]);
        return function(t) {
          projection.rotate(r(t));
              ctx.clearRect(0, 0, width, height);
              ctx.fillStyle = "#bbb", ctx.beginPath(), path(land), ctx.fill();
              ctx.strokeStyle = "#fff", ctx.lineWidth = .5, ctx.beginPath(), path(borders), ctx.stroke();
              ctx.strokeStyle = "#000", ctx.lineWidth = 2, ctx.beginPath(), path(globe), ctx.stroke();

  ctx.strokeStyle = "#bbb", ctx.fillStyle = "#bbb", ctx.lineWidth = 1, ctx.beginPath(), path(marshalls), ctx.fill, ctx.stroke();

              if(planeOn){
                ctx.fillStyle = "#f00", ctx.beginPath(), ctx.rect( Math.round(width / 2) - 4, Math.round(height / 2) - 4, 8, 8 ), ctx.fill();
              }
        };
      });
  };
  
  // start flight animation
  
  // start in Marshall Islands
  centerAt([7.071623, -180 - (180 - 171.552764)]);
  document.getElementById("sidebar").innerHTML += "<br/>Start on Majuro";
  setTimeout(function(){
    planeOn = true;
    centerAt([ (180-158)/(180-158+7.07) * (21.683414-7.071623), -180]);
    setTimeout(function(){
      document.getElementById("sidebar").innerHTML += "<br/>Cross Int'l Date Line";
      document.getElementById("time").innerHTML = "~10PM Thursday/Friday";
      centerAt([21.683414, -158.031954]);
      setTimeout(function(){
        document.getElementById("sidebar").innerHTML += "<br/>Layover in Honolulu";
        document.getElementById("time").innerHTML = "3:30AM-1PM Friday Hawai'i";
        setTimeout(function(){
          centerAt([37.77493, -122.419416]);
          document.getElementById("sidebar").innerHTML += "<br/>Fly to SF";
          document.getElementById("time").innerHTML = "3PM-8PM Friday Pacific";
          setTimeout(function(){
            planeOn = false;
            selectCountry("United States");
            document.getElementById("sidebar").innerHTML += "<br/>AMERICA";
          }, 1500);
        }, 1500);
      }, 1800);
    }, 1500);
  }, 2000);
}
